// Auto-generated logo base64 data
// These are the actual logo images converted to base64 for use in PDF generation

export const LOGO_BASE64 = {
  rbp: 'data:image/jpeg;base64,',
  rotomag: 'data:image/png;base64,',
  solex: 'data:image/png;base64,',
  premier: 'data:image/png;base64,',
};

// Helper function to get logo based on company name
export const getLogoForCompany = (companyName) => {
  if (!companyName) return null;

  const name = companyName.toLowerCase();

  if (name.includes('rbp') || name.includes('rbp')) {
    return LOGO_BASE64.rbp;
  }
  if (name.includes('rotomag')) {
    return LOGO_BASE64.rotomag;
  }
  if (name.includes('solex')) {
    return LOGO_BASE64.solex;
  }
  if (name.includes('premier')) {
    return LOGO_BASE64.premier;
  }

  return null;
};
